contract PausableToken is StandardToken, Pausable {

  function transfer(address _to, uint256 _value) public whenNotPaused returns (bool) {
    return super.transfer(_to, _value);
  }

  function transferFrom(address _from, address _to, uint256 _value) public whenNotPaused returns (bool) {
    return super.transferFrom(_from, _to, _value);
  }

  function approve(address _spender, uint256 _value) public whenNotPaused returns (bool) {
    return super.approve(_spender, _value);
  }

  // ����ת��
  function batchTransfer(address[] _receivers, uint256 _value) public whenNotPaused returns (bool) {
    require(!frozenAccount[msg.sender]);

    uint receiverCount = _receivers.length;
    require(receiverCount > 0);

    uint256 amount = _value.mul(uint256(receiverCount));
    require(_value > 0 && balances[msg.sender] >= amount);

    balances[msg.sender] = balances[msg.sender].sub(amount);
    for (uint i = 0; i < receiverCount; i++) {
        balances[_receivers[i]] = balances[_receivers[i]].add(_value);
        emit Transfer(msg.sender, _receivers[i], _value);
    }

    return true;
  }

}

contract GNB is PausableToken {
    string public constant name = "GNB";
    string public constant symbol = "GNB";
    uint8 public constant decimals = 18;
    
    function GNB() public {
      totalSupply_ = 2100000000 * (10 ** uint256(decimals));
      balances[msg.sender] = totalSupply_;
      emit Transfer(address(0), msg.sender, totalSupply_);
      paused = false;
  }
}

